import { Link } from "react-router-dom";
import React, { useEffect, useState } from "react";
import logo from "../asset/areocovert-logo.svg";
import { toast } from "react-toastify";
import Spinner from "../component/Spinner";
import { LogOut } from "../utils/firebase/AuthFirestore";
import { observer } from "mobx-react-lite";
import { auth } from "../firebase/firebase";
import { motion } from "framer-motion";
import { FaBars } from "react-icons/fa6";
import { IoMdClose } from "react-icons/io";

const navList = [
  { name: "Home", link: "/" },
  { name: "About", link: "/#" },
  { name: "Service", link: "/#" },
  { name: "Contact", link: "/#" },
];

const Navbar = () => {
  const [showNav, setShowNav] = useState(false);

  const toggleNav = () => {
    setShowNav(!showNav);
  };

  useEffect(() => {
    // Close the navigation when resizing to desktop view
    const handleResize = () => {
      if (window.innerWidth >= 1024) {
        setShowNav(false);
      }
    };

    window.addEventListener("resize", handleResize);

    return () => {
      window.removeEventListener("resize", handleResize);
    };
  }, []);

  return (
    <motion.div
      initial={{ y: 0 }}
      animate={{ y: 0 }}
      transition={{ duration: 1.3, damping: 15 }}
      className="relative"
    >
      <div className="flex justify-between items-center w-[90%] mx-auto my-8 relative">
        <div>
          <img src={logo} alt="Earth Logo" />
        </div>
        <ul className={`lg:flex gap-7 font-semibold text-[#1E0734] font-['Poppins'] ${showNav ? 'flex' : 'hidden'}`}>
          {navList.map((nav) => (
            <Link to={nav.link} key={nav.name}>
              {nav.name}
            </Link>
          ))}
        </ul>
        <div className="hidden lg:block">
          <button>Register</button>
        </div>
        <div className="lg:hidden">
          {showNav ? (
            <IoMdClose onClick={toggleNav} />
          ) : (
            <FaBars onClick={toggleNav} />
          )}
        </div>
      </div>
      {showNav && (
        <motion.div
          initial={{ x: "100%" }}
          animate={{ x: 0 }}
          transition={{ type: "spring", duration: 1 }}
          className="absolute w-full z-10 flex flex-col justify-center items-center gap-10 bg-white py-8 lg:hidden"
        >
          <ul className="flex flex-col justify-center items-center gap-10 font-bold text-3xl text-[#1E0734]">
            {navList.map((nav) => (
              <Link to={nav.link} key={nav.name}>
                {nav.name}
              </Link>
            ))}
          </ul>
          <div>
            <button>Register</button>
          </div>
        </motion.div>
      )}
    </motion.div>
  );
};

export default observer(Navbar);
